INSERT INTO `announcements` (`id`, `title`, `content`, `created_at`) VALUES
(1, 'راه اندازی پشتیبانی از Vimeo', 'به استحضار می رساند از این پس از ویدئو های سایت Vimeo نیز پشتیبانی می شود.', '2015-11-05 18:27:26'),
(2, 'افزودن امکان پخش آنلاین و پیش نمایش ویدئوها', 'ازین پس می توانید ویدئوها را پس از دانلود آنلاین ببینید. همچنین پیش از دانلود، پیش نمایشی از ویدئوها مشاهده نمایید.', '2015-11-08 15:50:30'),
(3, 'افزودن پکیج پایه ۵۱۲ مگابایت', 'بنا به درخواست کاربران محترم پکیج ۵۱۲ مگابایتی با هزینه ۱۵۰۰ تومان به فروشگاه اضافه شد', '2015-11-09 06:23:15'),
(4, 'افزودن برخی از ویدئوهای کاربران', 'قسمت برخی ویدئو های کاربران به سایت اضافه شد. این امکان به کاربران کمک می کند که ویدئوهای پر کاربرد را بدون نیاز به مصرف حجم دانلود کنند.', '2015-11-10 12:45:26'),
(5, 'رفع اختلال در موتور جست و جوی ویدئو', 'متاسفانه موتور جست و جوی ویدئو به دلیل مشکلات فنی به مدت ۲ ساعت در دسترس نبود که با تلاش تیم فنی مشکل رفع گردید', '2015-11-11 09:02:25'),
(6, 'کاهش هزینه پکیج ها به درخواست کاربران', 'با توجه به درخواست های مکرر کاربران مبتنی بر زیاد بودن هزینه پکیج ها حجم هر پکیج دو برابر شد و به خریداران قبلی نیز اضافه گردید', '2015-11-21 06:09:31');
INSERT INTO `comments` (`id`, `user_id`, `content`, `status`, `created_at`) VALUES
(1, 1, 'test mishavad', 'Declined', '2015-11-15 14:38:37'),
(2, 242, 'سلام و خسته نباشید\nمیخواستم بگم سایتتون واقعا مزیتی نسبت به سایتای دیگه ای که فیلمای یوتیوب رو رایگان برای دانلود میذارن نداره\nممنون', 'Declined', '2015-11-15 14:50:54'),
(3, 195, 'با سلام\n\nضمن عرض خسته نباشید بابت کار فوق العادتون\nاگر بتونید لیست دانلودهای پرشمار تو زمینه های مختلف را به صورت گروه های جدا داشته باشید، تو سرعت بچه ها واسه پیدا کردن ویدئوهای خاص مورد نظرشون توی هر گروه خاص بسیار مفید خواهد بود.\nممنون', 'Approved', '2015-11-15 17:37:17'),
(4, 521, 'tomibili', 'Declined', '2015-11-16 07:16:07'),
(5, 275, 'افتضاح', 'Declined', '2015-11-17 06:33:44'),
(6, 1, 'تست دیدگاه', 'Declined', '2015-11-19 10:53:34'),
(7, 8, 'اصلا هم خوب نیس الکی زور نزنینب.با تشکر سازمان خراب کردن روحیه B-)', 'Declined', '2015-11-19 10:54:49'),
(8, 374, 'عالی هستین \r\nدمتون گرم. همین امروز یه مشکل اساسی منو حل کردین.\r\nیا علی', 'Approved', '2015-11-19 10:56:04'),
(9, 385, 'سلام \r\n\r\nضمن تشكر از امكان جديدي كه براي دانلود از يوتوب فراهم كرديد، تنها مشكلي كه ديدم اين بود كه قدرت جستجوي سايت كمي پايين بود. به راحتي هر مطلبي رو نميشد جستجو كرد. شايد هم مشكل از روش جستجو كردن من بوده. \r\n\r\nبه هر حال بسيار بسيار ممنون ، در مجموع اقدام مفيد و جالبي بود', 'Waiting', '2015-11-19 14:40:45'),
(10, 609, 'سلام ، خسته نباشید\r\n\r\nبنده صرفا جهت تست ثبت نام کردم، ولی در کل با داشتن یک اکانت کریو و extension سایت en.savefrom.net خیلی راحتتر و به صرفه تر میشه فیلم هایی که می خوایم رو دانلود کنیم.\r\n\r\nتشکر', 'Waiting', '2015-11-19 14:58:00'),
(11, 456, 'سرویس خوبی است،جای تشکر دارد...فقط لطف کنید یه مقدار شرایط مربوط به هزینه استفاده برای دانشجویان شریف رو کاهش بدید....دانشجویان نیاز به حمایت بیشتری دارند...خدا خیرتون بده', 'Waiting', '2015-11-19 17:05:44'),
(12, 241, 'سلام\nبنده نتوانستم حتی یک بار از این سیستم استفاده کنم\nبه نظرم سیستم آن بسیار بد طراحی شده و اصلا user friendly نیست', 'Waiting', '2015-11-19 17:29:32'),
(13, 510, 'نظر من اینه که با وجود یوتیوب که نامحدود امکان دانلود فیلم هست این سایت باید با محدود بودن برنامه حرفی برای گفتن داشته باشه که به نظر من نداره', 'Waiting', '2015-11-19 21:26:05'),
(14, 66, 'سلام.\r\nبه نظرمن  همه با فیلتر شکن به یوتیوب دسترسی دارند و کسی نیاز به خرید از سایت شما پیدا نمی کند.\r\nبا تشکر', 'Waiting', '2015-11-20 05:12:27'),
(15, 533, 'با سلام\nهنوز از این سرویس استفاده نکردم. دیدگاه خاصی ندارم!\nبا تشکر', 'Waiting', '2015-11-20 06:08:16'),
(16, 154, 'مبالغ خیلی زیاد است در صورتیکه همین کار را با یک فیلتر شکن مجانی می توان انجام داد', 'Waiting', '2015-11-20 06:42:18'),
(17, 330, 'خیلی هزینه اش بالاس\r\nحداقل خودتون فیلم های خوب و پر بازدید رو دانلود کنید', 'Waiting', '2015-11-20 10:45:08'),
(18, 166, 'عالی!', 'Waiting', '2015-11-20 16:24:11');
